import React from 'react';
import { Redirect, Route } from 'react-router-dom';
const Restricted = ({ component: Cmp, ...rest }) => (
    <Route
        {...rest}
        render={(props) =>
            localStorage.getItem('id')
                ? <Redirect to="/friendlink"/>
                :(<Cmp {...props} />)
        }
    />
)
export default Restricted;
